import React from "react";
import { Card, Image, Flag } from "semantic-ui-react";
import { CardElement } from "../../assets/propTypes";
import {
  custom,
  arabic,
  egyptian,
  romanian,
  british,
  american,
} from "../../images";

const CustomUserCard = ({
  flag: string,
  email,
  password,
  userId,
  accessToken,
}: CardElement) => (
  <Card>
    <Image
      circular
      src={
        {
          tr: custom,
          us: american,
          sa: arabic,
          eg: egyptian,
          ro: romanian,
          uk: british,
        }[flag]
      }
      wrapped
      ui={false}
    />
    <Card.Content>
      <Card.Header>
        <span>Serbest Meslek ErbabÄ±</span>
      </Card.Header>
      <Card.Meta>
        ShapeShifter
        <span>
          <Flag style={{ marginLeft: "4px" }} name={flag} size="huge" />
        </span>
      </Card.Meta>
      <Card.Description>
        <div> Valar Morghulis</div>
      </Card.Description>
    </Card.Content>
    <Card.Content extra>
      something
      {/*       {["email", "password", "userId", "accessToken"].forEach((el) => {
        if (card.userId) {
          return ClipButtonHOC({ name: el, value: card.email });
        }
      })} */}
    </Card.Content>
  </Card>
);

export default CustomUserCard;
